import React from 'react';

import AppForm from '../../../components/form/appForm';
import AppInput from '../../../components/form/appInput';

const Security = () => {
  return (
    <AppForm>
      {options.map(o => (
        <AppInput {...o} />
      ))}
    </AppForm>
  );
};

const options = [
  {
    name: 'currentPassword',
    label: 'Current Password',
    value: '',
  },
  {
    name: 'password',
    label: 'New password',
    value: '',
  },
];

export default Security;
